import React from 'react';
import logo from './logo.svg';
import {Provider,defaultTheme,Grid,View, darkTheme,colorScheme,} from '@adobe/react-spectrum';
import './App.css';
import LoginForm from './components/Loginform';

function App() {
  return (
      <div className="App">
      <Provider theme={lightTheme} >

        <Grid >
          <View 
          borderWidth="thin" 
          borderColor="dark" 
          height="auto" 
          width="50%"
          justifySelf ="center"
          backgroundColor="static-white"> 
            <LoginForm />
          </View>
        </Grid>

      </Provider>
    </div>
  );
}

export default App;
